import styles from './Resource.module.css'
const data = [
  { 
    name: "Web",
    addon: "Development",
    data: "Examined as an existence in the soul of the Internet age, Web Development is a professional field which has helped the world envision numerous aspects of E-shopping, E-transition and many more ",
    img: webd,
  },
  {
    name: "Machine ",
    addon: "Learning",
    data: "this is a web development ... ",
    img:ml
  },
  {
    name: "Android",
    addon: "Development",
    data: "this is a web development ... ",
    img: and,
  },
  {
    name: "AR/VR",
    addon: "",
    data: "this is a web development ... ",
    img: meta,
  },
  {
    name: "Cyber",
    addon: "Security",
    data: "this is a web development ... ",
    img: cyber,
  },
  {
    name: "Graphics",
    addon: "Design",
    data: "this is a web development ... ",
    img: graphic,
  },
  {
    name: "Content",
    addon: "Writing",
    data: "this is a web development ... ",
    img: cyber,
  }
];
const Resource = () => {
  return (
    <div>
   <h2 className={styles.resource_heading}>Essential Tech Resources for Developers.</h2>
   <div className={styles.domain_container}>
          {data.map((e) => (
            <Domaincard addon={e.addon} key={e} name={e.name} img={e.img} data={e.data} />
          ))}
        </div>
    </div>
  )
}

export default Resource
